DROP TABLE IF EXISTS `qw_order_hf`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `qw_order_hf` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `uid` int(11) NOT NULL COMMENT '分销商ID',
  `user` varchar(50) NOT NULL COMMENT '用户名',
  `mobile` varchar(20) NOT NULL COMMENT '用户电话',
  `fluxid` int(10) DEFAULT NULL COMMENT '商品ID',
  `fluxnum` int(10) DEFAULT NULL COMMENT '流量大小,如10M',
  `goodsname` varchar(50) DEFAULT NULL COMMENT '商品名称',
  `order_ret` int(1) DEFAULT '1' COMMENT '订单是否提交成功,0成功，非0表示失败',
  `notify_ret` int(4) DEFAULT NULL COMMENT '充值后对方返回的值，0表示成功',
  `description` varchar(255) DEFAULT NULL COMMENT '备注',
  `created_at` int(11) DEFAULT NULL COMMENT '创建时间',
  `updated_at` int(11) DEFAULT NULL COMMENT '修改时间',
  `notify_time` int(11) DEFAULT NULL COMMENT '回调时间',
  `trans_time` int(11) DEFAULT NULL COMMENT '平台发货时间',
  `actived` tinyint(1) DEFAULT '1' COMMENT '1:生效;0:无效',
  `orderno` varchar(32) DEFAULT NULL COMMENT '订单号',
  `orderid` varchar(32) DEFAULT NULL COMMENT '返回的订单号',
  `scope` tinyint(255) DEFAULT NULL COMMENT '流量使用范围： 1-全国 2-省内',
  `areacode` varchar(5) DEFAULT NULL COMMENT '城市编码',
  `activeflag` tinyint(1) DEFAULT NULL COMMENT '流量生效时间：0-当月 1-下月   ',
  `expiration` tinyint(1) DEFAULT NULL COMMENT '流量有效期,1-一个月 3-季包 6-半年包 12-年包',
  `created_type` tinyint(1) DEFAULT '1' COMMENT '1:手工录入;2:导入',
  `backurl` varchar(256) DEFAULT NULL COMMENT '回调URL',
  `iftype` tinyint(4) DEFAULT NULL COMMENT '0:本系统;1:rest接口',
  `operator` tinyint(4) DEFAULT NULL COMMENT '运营商,1-移动 2联通 3-电信',
  `sign` varchar(100) DEFAULT NULL COMMENT '签名',
  `price` float DEFAULT NULL COMMENT '实际价格',
  `desc` varchar(256) DEFAULT '',
  `status` tinyint(1) DEFAULT '1' COMMENT '0:无效;1:有效',
  `areaid` varchar(20) DEFAULT NULL,
  `unused` float DEFAULT NULL,
  `callbacktimes` tinyint(2) DEFAULT '0',
  `batchid` varchar(20) DEFAULT '0',
  `selfcost` float DEFAULT NULL COMMENT '成本价',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=570 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

